import Modal from 'react-modal'
import {useState} from 'react'

export default function Login({visible, setVisible}) {
    return(
        <div>
            <Modal isOpen={visible}>
                <div onClick={() => setVisible(false)}>x</div>
                <h1>Model Body</h1>
            </Modal>
        </div>
    )
}
